function filterMovies() {
    let startDate = new Date(document.getElementById('startDate').value);
    let endDate = new Date(document.getElementById('endDate').value);
    let filteredMovies = movies.filter(movie => {
        let movieDate = new Date(movie.date);
        return movieDate >= startDate && movieDate <= endDate;
    });
    displayMovies(filteredMovies);
}

function displayMovies(movies) {
    let moviesDiv = document.getElementById('movies');
    moviesDiv.innerHTML = '';
    movies.forEach(movie => {
        let movieDiv = document.createElement('div');
        movieDiv.classList.add('movie');
        movieDiv.innerHTML = `
            <img src="${movie.image}" alt="${movie.name}">
            <h2>${movie.name}</h2>
            <p>${movie.message}</p>

            <div class="stars">
                ${[...Array(parseInt(movie.rating))].map(() => '<span class="star filled">★</span>').join('')}
                ${[...Array(10 - parseInt(movie.rating))].map(() => '<span class="star">★</span>').join('')}
            </div>
            <p>Rate: ${movie.rating}</p>
            <p class="date-box">${movie.date}</p>
        `;
        moviesDiv.appendChild(movieDiv);
    });
}

